#########################################################################
# Change Project Name to the one that will be used for testing framework
$ProjectName = "INTEGRATION_TEST";
#########################################################################

# Open connection to Output database
$OutputConn = $SourceConnection.CreateOpenConnection();
$OutputCmd = $OutputConn.CreateCommand();

# Obtain database type of current Output connection
$GetType = $OutputConn.GetType();
$OutputDriverType =
    switch ($GetType){
        "System.Data.SqlClient.SqlConnection" {"Microsoft SQL Server"}
        "Snowflake.Data.Client.SnowflakeDbConnection" {"Snowflake"}
    };

# Obtain the schema of output objects
$OutputCmd.CommandText = "SELECT PROJECTID FROM LM__REF.LM__MAPPING WHERE PROJECTNAME = '$ProjectName'";
$ProjectReader = $OutputCmd.ExecuteReader();

$ProjectReader.Read() | Out-Null;
$OutputSchema = "LM__$($ProjectReader["PROJECTID"])";

$ProjectReader.Close();

# Define other schemas
$PStgSchema =
    switch ($OutputDriverType) {
        "Snowflake" {"""DGStg"""}
        Default {"DGStg"}
    }
$ERSchema =
    switch ($OutputDriverType) {
        "Snowflake" {"""Monitor"""}
        Default {"Monitor"}
    }

# For Snowflake output, ensure schema exists to avoid error when run testing framework for the first time
if ($OutputDriverType -eq "Snowflake") {
    $OutputCmd.CommandText = "CREATE SCHEMA IF NOT EXISTS $OutputSchema";
    $OutputCmd.ExecuteNonQuery() | Out-Null;
}

# Obtain ID of rules and test cases of testing framework, and processing database objects removal
$OutputCmd.CommandText = "SELECT RULEID, LEFT(RULENAME, CHARINDEX('_', RULENAME)-1) AS TESTCASEID FROM LM__REF.LM__MAPPING WHERE PROJECTNAME = 'INTEGRATION_TEST'";
$RuleReader = $OutputCmd.ExecuteReader();

$SqlCmds = @()
While ($RuleReader.Read()) {
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__DATACURRENT";
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__DATAHISTORY";
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__METADATACURRENT";
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__METADATAHISTORY";
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__RESULTS";
    $SqlCmds += "DROP VIEW IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__SLICERS";
    $SqlCmds += "DROP TABLE IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__COMMUNICATIONS";
    $SqlCmds += "DROP TABLE IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__DATA";
    $SqlCmds += "DROP TABLE IF EXISTS $OutputSchema.LM__$($RuleReader["RULEID"])__METADATA";
    $SqlCmds += "DROP VIEW IF EXISTS $PStgSchema.LM__$($RuleReader["RULEID"])__DATAHASH";
    $SqlCmds += "DROP VIEW IF EXISTS $PStgSchema.LM__$($RuleReader["RULEID"])__METADATAHASH";
    $SqlCmds += "DROP TABLE IF EXISTS $PStgSchema.LM__$($RuleReader["RULEID"])__DATA";
    $SqlCmds += "DROP TABLE IF EXISTS $PStgSchema.LM__$($RuleReader["RULEID"])__METADATA";
    $SqlCmds += "DROP TABLE IF EXISTS $ERSchema.MONITOR_$($RuleReader["TESTCASEID"])_ER";
    $SqlCmds += "DELETE FROM LM__REF.LM__MAPPING WHERE RULEID = $($RuleReader["RULEID"])";
}

$RuleReader.Close();

Foreach ($SqlCmd in $SqlCmds) {
    $OutputCmd.CommandText = $SqlCmd;
    $OutputCmd.ExecuteNonQuery() | Out-Null;
}

# Close database connection
$OutputConn.Close();
